import React, { Component, Fragment } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import NotFoundPage from './pages/NotFoundPage';
import HelloPage from './pages/HelloPage';
import HelpPage from './pages/HelpPage';
import MyAppointmentsPage from './pages/MyAppointmentsPage';
import AppointmentPage from './pages/AppointmentPage';
import AuthorizationPage from './pages/AuthorizationPage';

import logo from './logo.svg';
import './App.css';
import Header from './components/Header/Header';


const items = {
	authorization: "Авторизация",
	add_appointment: "Записатьcя",
	my_appointments: "Мои записи",
	help: "Помощь",
}

class App extends React.Component {
  handleSubmit = person => {
    this.setState(person);
    console.log(person)
	};

  render() {
    return (
      <div className="App">
        <Router>
          <Fragment>

            <Header links={items} />

            <Switch>

              <Route exact path="/" component={HelloPage} />

              <Route path="/authorization">
                <AuthorizationPage handleSubmit={this.handleSubmit} />
              </Route>

              <Route path="/add_appointment">
                <AppointmentPage person={this.state} />
              </Route>

              <Route path="/my_appointments">
                <MyAppointmentsPage person={this.state} />
              </Route>

              <Route path="/help" component={HelpPage} />

              <Route path="/" component={NotFoundPage} />

            </Switch>

          </Fragment>
        </Router>
     </div>
    );
  };
};

export default App;
